import { Carousel } from "react-bootstrap";
import "./Banner.css";
import b1 from "./assets/b1.jpeg";
import b2 from "./assets/b2.jpeg";
import b3 from "./assets/b3.jpeg";

export default function Banner() {
  return (
    <Carousel fade className="banner-carousel" interval={2000}>
      <Carousel.Item>
        <img className="d-block w-100" src={b1} alt="Slide 1" />
        <Carousel.Caption>
          <h3>Welcome to Aeternus Energy</h3>
          <p>Powering the future with sustainable energy.</p>
        </Carousel.Caption>
      </Carousel.Item>

      <Carousel.Item>
        <img className="d-block w-100" src={b2} alt="Slide 2" />
        <Carousel.Caption>
          <h3>Innovative Solar Solutions</h3>
          <p>Providing clean and renewable energy worldwide.</p>
        </Carousel.Caption>
      </Carousel.Item>

      <Carousel.Item>
        <img className="d-block w-100" src={b3} alt="Slide 3" />
        <Carousel.Caption>
          <h3>Join the Green Revolution</h3>
          <p>Building a better tomorrow, one panel at a time.</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}
